import React, { useContext } from "react";

import { ApiContext } from "./ApiProvider";

function App() {

  const data = useContext(ApiContext);

  return (
    <div className="tmp">
      <h1>Hello !!</h1>
      {data.map((e) => { return <p>{ e }</p>})}
    </div>
  );

};

export default App;
